import React from "react";
import Picture from "./beastHarkonnen.gif";

function BeastHarkonnen () {
    return (
        <div id="beastHarkonnen">
            <img src={Picture} alt="Beast Harkonnen" height="450" width="400"/>
        </div>
    );
}

export default BeastHarkonnen;
